import {BrowserRouter,Redirect} from "react-router-dom";
//import Managermain3 from "../Managerpg3/Managermain3"
import { Form, TextArea,Button,Segment } from 'semantic-ui-react';
import axios from 'axios'

class Empmain1 extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            id:24,
            month:'',

        }
    }


   setRedirect1 =(e) => {
        this.setState({
            redirect1: true
        })   
    }  


    setRedirect2 =(e) => {
        this.setState({
            redirect2: true
