    render() {
        {
            if (this.state.redirect1) {
                return <Redirect to="/emp-feedback"/>;    
            }
            else if(this.state.redirect2) {
                return <Redirect to="/emp-goals"/>;    
            }
        }

        return (
            <div className="manbg">
                <Managerheader1/>
                <ManagerNav/>

