      <a class="item">Tab 3</a>
    </div>
    <div class="ui bottom attached segment active tab">Tab 1 Content</div>
  </div>
  <div class="ui tertiary segment"><pre>{}</pre></div>
</div>


    </nav>
</BrowserRouter>
